const doLoadMembers = (members) => {
    return {
      type: 'LOADMEMBERS',
      payload: members,
    };
  };

  const doEditMember = (member) => {
    return {
      type: 'EDITMEMBER',
      payload: member,
    };
  };

  export  { doLoadMembers, doEditMember }
